import React from 'react';

function Gallery(): JSX.Element {
  const images = [
    'https://images.unsplash.com/photo-1552820728-8ac41f1ce891?w=1200&h=800&fit=crop',
    'https://images.unsplash.com/photo-1568605114967-8130f3a36994?w=1200&h=800&fit=crop',
    'https://images.unsplash.com/photo-1549399542-7e3f8b83ad38?w=1200&h=800&fit=crop',
    'https://images.unsplash.com/photo-1503376780353-7e6692767b70?w=1200&h=800&fit=crop',
  ];

  return (
    <div className="max-w-7xl mx-auto py-16 px-4 sm:px-6 lg:px-8 fade-in">
      <h1 className="text-3xl font-bold mb-6">Gallery</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {images.map((src, idx) => (
          <div key={idx} className="rounded overflow-hidden shadow-lg">
            <img src={src} alt={`gallery-${idx}`} className="w-full h-72 object-cover" />
            <div className="p-4">
              <h3 className="font-bold">Car {idx + 1}</h3>
              <p className="text-sm text-gray-600">Some details about this car.</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Gallery;
